export const courseNumberColor = (courseNum: number): string => {
    if (courseNum < 200) {
      return "#3bb87c";
    } else if (courseNum < 300) {
      return "#326932"
    } else if (courseNum < 400) {
      return "#1c381c"
    } else if (courseNum < 500) {
      return "#1e3b22"
    }

    return "#414f41";
}
